import React from "react";
import { NavLink } from "react-router-dom";
import "./Footer.css";


const Footer: React.FC = () => {
      return (<>
      <footer>
        <NavLink  to="">Contact Us</NavLink>      
        <NavLink to="">Term of Use</NavLink>      
        <NavLink to="">Privacy Policy</NavLink>      
      </footer>
        </>
      )
    }

export default Footer;
